import './App.css';
import Home from './components/home';
import Header from './components/header';
import Footer from './components/footer';
import ReactDOM from 'react-dom';
import {BrowserRouter, Link, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header/>
      <Route exact path="/">
        <Home />
      </Route>

      <Footer/>
    </div>
  );
}

export default App;
